import React from 'react';
import ReactSpinner from 'react-bootstrap-spinner'
export default function Plot(props) {
    return (
        <div>
            <ReactSpinner type="border" color="primary" size="5" />
            <img src={props.src} alt='graph'/>
        </div>
    );
}

